import React, {Component} from 'react';

class Header extends Component {
  render() {
    return (
      <div class="row mb-5 align-items-center">
        <div class="col-md-12 col-lg-6 mb-4 mb-lg-0" data-aos="fade-up">
          <h2>React News App</h2>
          <p class="mb-0">Developed by Olaoye Anthony Somide</p>
        </div>

        <div class="col-md-12 col-lg-6 text-left text-lg-right" data-aos="fade-up" data-aos-delay="100">
          <div id="filters" class="filters">
            <a href="#" data-filter="*" class="active">All</a>
            <a href="#" data-filter=".web">Politics</a>
            <a href="#" data-filter=".design">Business</a>
            <a href="#" data-filter=".branding">Sports</a>
            <a href="#" data-filter=".photography">Cryptos</a>
          </div>
        </div>
      </div>
    );
  }

}

export default Header;
